import React from "react";
import Carousel from "react-bootstrap/Carousel";
import Image from "react-bootstrap/Image";

export default function HomePage() {
  return (
    <>
      <Carousel>
        <Carousel.Item>
          <Image
            src="https://about.att.com/ecms/dam/snr/2022/september2022/storylevelbanner/iconic_STORY_LEVEL_BANNER_1600x483.jpg"
            fluid
          />
          ;
        </Carousel.Item>
        <Carousel.Item>
          <Image
            src="https://storage-asset.msi.com/global/picture/article/article_147485993957e893a37e2ef.jpg"
            fluid
          />
          ;
        </Carousel.Item>
        <Carousel.Item>
          <Image
            src="https://about.att.com/ecms/dam/snr/2022/september2022/storylevelbanner/iconic_STORY_LEVEL_BANNER_1600x483.jpg"
            fluid
          />
          ;
        </Carousel.Item>
      </Carousel>
      <h1>This is Homepage</h1>
    </>
  );
}
